const RegS=()=>{
    let year= 1820;
    let myname=" JOSHY";

    const count = (hrs) =>{
        return hrs*500;
    }

    const looptry =()=>{
        var text="";
        for(var i=0;i<10;i++)
        {
            text=text+" "+i;
        }
        return text;
    }

    return (
        <>
          <hr/>
          <h2 style="">My Profile</h2>
          <ol>
              <li>NAME:{myname}</li>
              <li>BDATE:{2022-year}</li>
              <li>Hours Worked:10</li>
              <li>Salary:{count(10)}</li>
              <li>disp:{looptry()}</li>
              {console.log("HI!")}
          </ol>
        </>
       
      );
}
export default RegS;
